import React from 'react';
import logo from './logo.svg';

const Contact = () => {
  return (
    <>
      <div className="my-5 py-5">
        <h1 className="text-center">
          Contact US
        </h1>
      </div>
      <div className="container contact-div">
        <div className="row">
          
        </div>
      </div>
    </>
  )
}

export default Contact;
